import React from 'react';


export class ArbrePage extends React.Component {
    render() {
        const myOverviewDivStyle = {
            margin: '40px',
            border: '5px solid pink',
            position: 'relative',
            // "-webkit-tap-highlight-color": rgba(255, 255, 255, 0)
            // position: relative; -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
          };
          const myOverviewDivSecondStyle = {
            margin: '40px',
            border: '5px solid pink',
            position: 'relative',
            // "-webkit-tap-highlight-color": rgba(255, 255, 255, 0)
            // "position: absolute; overflow: auto; width: 71px; height: 1px; z-index: 1;"
          };
        const myDiagramDivStyle = {
            margin: '40px',
            // "background-color: white; border: 1px solid black; width: 100%; height: 100vh; --darkreader-inline-bgcolor:#181a1b; --darkreader-inline-border-top:#666666; --darkreader-inline-border-right:#666666; --darkreader-inline-border-bottom:#666666; --darkreader-inline-border-left:#666666; position: relative; -webkit-tap-highlight-color: rgba(255, 255, 255, 0);"
          };
        const canvasOneStyle = {
            // "position: absolute; top: 0px; left: 0px; z-index: 2; user-select: none; width: 71px; height: 1px;"
        };
        const canvasSecondStyle = {
            // "position: absolute; top: 0px; left: 0px; z-index: 2; user-select: none; width: 69px; height: 918px;"
        }
        const myDiagramDivOneStyle = {
            // "position: absolute; overflow: auto; width: 69px; height: 935px; z-index: 1;"
        }
        const myDiagramDivSecondStyle = {
            // "position: absolute; width: 14396px; height: 1px;"
        }
      return (
            <div>
                <button id="idDisplayArbre" className="btn btn-outline-info m-2">Cliquer pour afficher l'arbre</button>
                <div id="divGlobalDiagram" className="container-fluid">
                    <input id="mySearch" className="m-2" type="search" placeholder="Chercher par Prenom"></input>
                        <button id="" className="btn btn-primary m-2">Chercher</button>
                    <div id="myOverviewDiv" className="" style={myOverviewDivStyle}>
                        <canvas tabindex="0" width="71" height="1" style={canvasOneStyle}>This text is displayed if your browser does not support the Canvas HTML element.</canvas>
                        <div style={myOverviewDivSecondStyle}>
                            <div style="position: absolute; width: 1px; height: 1px;"></div>
                        </div>
                    </div>
                    <div id="myDiagramDiv" className="mt-3" style={myDiagramDivStyle} data-darkreader-inline-bgcolor="" data-darkreader-inline-border-top="" data-darkreader-inline-border-right="" data-darkreader-inline-border-bottom="" data-darkreader-inline-border-left="">
                        <canvas tabindex="0" width="69" height="918" style={canvasSecondStyle}>This text is displayed if your browser does not support the Canvas HTML element.</canvas>
                        <div style={myDiagramDivOneStyle}>
                            <div style={myDiagramDivSecondStyle}></div>
                        </div>
                    </div>
                </div>
            </div>
      );
    }
  }
